import React from "react";
import { WorkgroupResult, RxWorkgroupLabel } from ".";

export const Workgroup = ({ workgroup, workoutIndex, workgroupIndex }) => {
  return (
    <div className="bg-gray-200 p-3 my-1 flex-col flex-1 rounded">
      <div className="flex ">
        <RxWorkgroupLabel
          workoutIndex={workoutIndex}
          workgroupIndex={workgroupIndex}
          workgroup={workgroup}
        />
      </div>
      <div>
        <WorkgroupResult
          workoutIndex={workoutIndex}
          workgroupIndex={workgroupIndex}
          workgroup={workgroup}
        />
      </div>
    </div>
  );
};
